function Header() {
    return (
        <Navbar bg={"dark"} variant={"dark"} className={'navbar-padding'}>
            <Navbar.Brand href={"#home"}>
                Cours React
            </Navbar.Brand>
            <Navbar.Brand href={"#todo"}>
                Todo
            </Navbar.Brand>
        </Navbar>
    )
}

export default Header;
